	private string AluminiumGrid_GetReshitkaName(string typ, string ral, bool anodovane, string B, string H, string sposibKriplennjaStr, bool notRegular, bool isFasadna, bool hasSitka)
	{
		string text;
		if (anodovane)
		{
			text = "A";
		}
		else
		{
			int num = ral.IndexOf(" ");
			text = ((num > 0) ? ral.Substring(0, num) : ral);
		}
		string text2 = (notRegular ? "нерегульована" : "регульована");
		string text3 = "Решітка " + typ + " " + text2 + " АРТ-";
		text3 += ((typ == "однорядна") ? "1" : "2");
		text3 += (notRegular ? "N" : string.Empty);
		text3 += (isFasadna ? " (Фасадна" : string.Empty);
		text3 += (hasSitka ? " з сіткою)" : ") ");
		text3 = text3 + " (" + text + ") ";
		text3 = text3 + B + "x" + H + "h";
		int num2 = AluminiumGrid_GetSposibKriplennjaIndex(sposibKriplennjaStr);
		return (num2 == 0 || num2 == 1) ? (text3 + "*") : text3;
	}

	private string AluminiumGrid_GetTypReshitky(string typ)
	{
		string result = string.Empty;
		if (!(typ == "однорядна"))
		{
			if (typ == "дворядна")
			{
				result = "2";
			}
		}
		else
		{
			result = "1";
		}
		return result;
	}

	private int AluminiumGrid_GetSposibKriplennjaIndex(string sposibKriplennja)
	{
		return sposibKriplennja switch
		{
			"отвори потай + гвинт 3.5х25" => 0, 
			"отвори потай" => 1, 
			"затискач" => 2, 
			_ => 3, 
		};
	}

