	private void GridViewColumnHeader_ClickedHandler(object sender, RoutedEventArgs e)
	{
		if (e.OriginalSource is GridViewColumnHeader)
		{
			object originalSource = e.OriginalSource;
			object obj = ((originalSource is GridViewColumnHeader) ? originalSource : null);
			object obj2;
			if (obj == null)
			{
				obj2 = null;
			}
			else
			{
				GridViewColumn column = ((GridViewColumnHeader)obj).Column;
				obj2 = ((column == null) ? null : column.Header?.ToString());
			}
			string text = (string)obj2;
			if (!string.IsNullOrEmpty(text) && ((CollectionView)((ItemsControl)List).Items).Count != 0)
			{
				SortListViewByHeader(text);
			}
		}
	}

	private void ThicknessOfMetalSetDefaultValues(ComboBox thicknessOfMetalCbox)
	{
		if (thicknessOfMetalCbox != null && ((CollectionView)((ItemsControl)thicknessOfMetalCbox).Items).Count == 0)
		{
			((UIElement)thicknessOfMetalCbox).IsEnabled = true;
			string numberDecimalSeparator = CultureInfo.CurrentCulture.NumberFormat.NumberDecimalSeparator;
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "5"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "65"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "68"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "7"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "9"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("1" + numberDecimalSeparator + "0"));
			if (thicknessOfMetalCbox != comboBox_thicknessOfMetalRoundAirPSK)
			{
				((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("1" + numberDecimalSeparator + "2"));
			}
		}
	}

	private void ThicknessOfMetalSetValues(ComboBox markaStali, ComboBox thicknessOfMetalCbox)
	{
		if (thicknessOfMetalCbox == null)
		{
			return;
		}
		((ItemsControl)thicknessOfMetalCbox).Items.Clear();
		string text = ((markaStali != null) ? markaStali.GetValue() : "Оцинковка");
		string numberDecimalSeparator = CultureInfo.CurrentCulture.NumberFormat.NumberDecimalSeparator;
		((UIElement)thicknessOfMetalCbox).IsEnabled = true;
		switch (text)
		{
		case "Оцинковка":
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "5"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "65"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "68"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "7"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "9"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("1" + numberDecimalSeparator + "0"));
			if (thicknessOfMetalCbox != comboBox_thicknessOfMetalRoundAirPSK)
			{
				((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("1" + numberDecimalSeparator + "2"));
			}
			break;
		case "Чорна":
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "5"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("0" + numberDecimalSeparator + "8"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("1" + numberDecimalSeparator + "0"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("1" + numberDecimalSeparator + "2"));
			((ItemsControl)thicknessOfMetalCbox).Items.Add((object)("1" + numberDecimalSeparator + "5"));
