	private void Join_Click(object sender, RoutedEventArgs e)
	{
		//IL_001e: Unknown result type (might be due to invalid IL or missing references)
		if (((CollectionView)((ItemsControl)List).Items).Count == 0)
		{
			MessageBox.Show("Список виробів пустий!");
			return;
		}
		ListItemsCheckOrderDuplicates();
		List<IProduct> productsFromList = GetProductsFromList(List);
		itemsToDelete = new List<int>();
		string[] ignore = new string[8] { "Id", "Order", "TypeOfProduct", "Amount", "Section", "IsChosen", "FullPrice", "MaterialCost" };
		for (int i = 0; i < productsFromList.Count; i++)
		{
			if (itemsToDelete.Contains(productsFromList[i].Order))
			{
				continue;
			}
			for (int j = 0; j < productsFromList.Count; j++)
			{
				if (productsFromList[i].Name == productsFromList[j].Name && i != j && AreInstancePropertiesEqual(productsFromList[i], productsFromList[j], ignore))
				{
					productsFromList[i].Amount += productsFromList[j].Amount;
					productsFromList[i].FullPrice += (double)productsFromList[i].Amount * productsFromList[i].Price;
					if (productsFromList[i].MaterialCost != productsFromList[j].MaterialCost)
					{
						productsFromList[i].MaterialCost = (productsFromList[i].MaterialCost + productsFromList[j].MaterialCost) / 2.0;
					}
					itemsToDelete.Add(productsFromList[j].Order);
				}
			}
		}
		if (itemsToDelete.Count > 0)
		{
			DeleteProductsFromList(itemsToDelete);
			ReorderProductsList(GetProductsFromList(List));
		}
		CalculateTotalMarkup();
	}

